"use strict";
{
    // basic data type
    // primitive type
    // string
    var name_1 = "Md Monjur akth Mazumder";
    console.log({ name: name_1 });
    // number
    var roll = 123;
    console.log({ roll: roll });
    // boolean
    var ok = false;
    console.log({ ok: ok });
    // undefine
    var x = undefined;
    console.log({ x: x });
    // null
    var y = null;
    console.log({ y: y });
    // any
    var z = void 0;
    console.log({ z: z });
    // non-primitive type
    // Array
    var friend = ["Md", " Monjur", "bakth"];
    console.log({ friend: friend });
    var friendRoll = [2, 3, 4, 6, 7, 3, 4];
    console.log({ friendRoll: friendRoll });
    // tuple --> --array --> order --> type of value
    var coordinates = [1, 2, 3];
    console.log({ coordinates: coordinates });
    var ageName = [21, "Md Monjur Bakth Mazumder"];
    console.log(ageName);
}
